import React,{Component} from 'react'
import { Link,Switch ,Redirect,Route} from 'react-router-dom'
import Delete from './subcomponent/delete';
import Homepage from './subcomponent/patient/homepage';
import HttpCallComponent from './subcomponent/httpsecurecomponent';
// import Patient from './subcomponent/Patient';

class Masterroute extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <div >
                <Switch>
                    <Route exact path='/' component={HttpCallComponent} />
                    <Route exact path='/homepage' component={Homepage}/>
                    {/* <Route exact path='/delete/:id' component={Delete} /> */}
                    {/* <Route exact path='/homepage/patient' Component={Patient}/> */}
                </Switch>
            </div>
         );
    }
}
 
export default Masterroute;
